import React, { Component } from 'react'
import Navbar from '../components/Navbar';
import Fab from '../components/Fab';
import styled from "styled-components";
import Axios from 'axios';

const Container = styled.div`
display: flex;
flex-direction: column;
justify-content: center;
align-items: center;
margin: 0 auto;
width: 100%;
`


export class indonesia extends React.Component {
  constructor(props){
    super(props);
    this.state = {
      name: "",
      title: "",
      errorCode: 200,
      dataCovid: []
    }
  }

  getData = async () => {
    try {
      const data = await Axios.get ("https://newsapi.org/v2/top-headlines?q=covid&country=id&apiKey=4055e2c89faa40e384b1dd16c0daef44")
      this.setState({
        dataCovid: data.data.articles
      })
    } catch (error) {
      if  (error.response.status === 500) {
        console.log("error");
      }
    }
  }
  render() {
    return (
      <Container>
        <h1>Covid News - Indonesia</h1>
        <Navbar />
        <Fab />
      </Container>
    )
  }
}

export default indonesia;
